    "2013-03-15T23:52:55.418462",nt"name": "tennessee-well-header-data",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset is a compilation of well header
    features compiled by the Tennessee Division of Geology, published as a web feature
    service, a web map service, an ESRI service and as an Excel spreadsheet for the
    National Geothermal Data System. The document contains 9 worksheets, including information
    about the template, instructions for using the template, notes related to revisions
    of the template, Resource provider information, the data, a field list (data mapping
    view) and a worksheet with vocabularies for use in populating the spreadsheet (data
    valid terms). Data from 1200 wells are included. Fields in the data table include
    HeaderURI, WellName , APINo, Label, OtherID, OtherName, BoreholeName, ParentWellURI,
    Operator, MineralOwner, Driller, LeaseName, SpudDate, EndedDrillingDate, DrillingMethod,
    WellType, etc. ",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
